include('system/verifica_session.php');
include('system/conection.php');

$session = $_SESSION['usuario'];

$query_pedidos = coletar_dados("select * from pedidos where id_usuario_pedinte = $session");

if (mysqli_num_rows($query_pedidos) > 0) {
    $sql = "select * from livros inner join usuarios on livros.id_usuario_dono = usuarios.id_user where livros.id_usuario_dono != $session ";
    while ($dados_pedidos = mysqli_fetch_assoc($query_pedidos)) {
        $sql = $sql . " and livros.id_livro != " . $dados_pedidos['id_livro'];
    }
} else {
    $sql = "select * from livros inner join usuarios on livros.id_usuario_dono = usuarios.id_user where livros.id_usuario_dono != $session";
}

$pesqt = 0;

if (isset($_GET['pesquisa_bnt'])) {
    $sql = $sql . " and nome_livro like '%" . $_GET['pesquisa'] . "%'";
    if ($_GET['pesquisa_bnt'] == '') {
        $pesqt = 1;
    }
}

$sql = $sql . ' order by nome_livro';

$query_livros = coletar_dados("$sql");

$foto_perfil = substr(mysqli_fetch_assoc(coletar_dados("select nome_usuario from usuarios where id_user = $session"))['nome_usuario'], 0, 1);

